css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://nodejs.org/docs/"), url-prefix("http://nodejs.org/api/") {
  body{background:#46483e !important;color:#eee !important;}
  h1,h2,h3,h4,h5,h6{color:#eee !important;}
  #container{background:#222 !important;color:#eee !important;}
  .sh_sourceCode,p tt,p code{background:#111 !important;border-color:#333 !important;}
  .sh_sourceCode .sh_symbol, .sh_sourceCode .sh_cbracket{color:#999 !important;}
  a{color:#8C0 !important;}
  a:active,a:visited{color:#690 !important;}
  .apidoc #apicontent p, .apidoc #apicontent li {color:#ccc !important;}
  #intro.interior a {
    background: url(http://nodejs.org/logo.png) !important;
    display: block !important;
    margin-left: 115px !important;
    width: 245px !important; 
    height: 66px !important;
  }
  #logo { display: none !important; }
}
